import AdminCustomerSidebar from "./AdminCustomerSidebar/AdminCustomerSidebar";

export default function Customers() {
    return (
        <div className='Customers'>
            <Route path="/admin/customers">
                <AdminCustomerSidebar />
            </Route>
        </div>
    )
}
